import React from 'react';
import propTypes from 'prop-types';

const Hashtag = ({tag})=>{
    console.log(tag);
    return (
        <div>Hashtag {tag}</div>
    );
};

Hashtag.propTypes={
    tag : propTypes.string.isRequired,
}

Hashtag.getInitialProps=async(context)=>{
    console.log('hashtag get Initial tag',context.query.tag);
    return {tag : context.query.id};
}

export default  Hashtag;
